comments.message:
We encountered design issue which we tried to solve by adding this property if you have other ideas it would be helpful. Let me explain the issue, during PATCH operation you can modify one or more properties in bmcweb there is whole context of PATCH request, but backend get few separate calls for single request.

For example:
{
  "ReportingType": "Periodic",
  "Schedule": { "RecurrenceInterval": "PT5S" }
}

It is translated to two set property requests on dbus.
"Set", "ReportingType", "Periodic"
"Set", "Schedule", 5000

After completing first request report will be in invalid state because it will be set to "Periodic", but schedule is not yet change. And we have no way in backend to tell if there will be update for "Schedule". So unless we want to duplicate all error handling in bmcweb we needed to provide additional property which describes errors. This allows to implement "State" property correctly without creating copy of validation code in bmcweb and it is foundation to implement "Conditions" property in the future.
